import React from "react";
import poster from "../assets/images/video-list-0.jpg";
import playButton from "../assets/icons/svg/icon-play.svg";
import fullscreenButton from "../assets/icons/svg/icon-fullscreen.svg";
import pauseButton from "../assets/icons/svg/icon-pause.svg";
import volumeButton from "../assets/icons/svg/icon-volume.svg";
//import scrubberControl from "../assets/icons/svg/icon-scubber-control.svg";

export default function Video() {
  return (
    <div className="video__container">
      <video className="video__video" poster={poster}>
        Your browser does not support this video tag
      </video>

      <div className="video__control-container">
        <button className="video__play">
          <img src={playButton} alt="Play Button" />
        </button>
        <div className="video__progress-container">
          <div className="video__progress">
            <img
              className="video__scrubber-img"
              src={scrubberControl}
              alt="video progress"
            />
          </div>
        </div>
        <div className="video__volume-screen-container">
          <button className="video__screen-button">
            <img
              src={fullscreenButton}
              alt="screen button"
              className="video__screen-button-img"
            />
          </button>
          <button className="video__volume-button">
            <img
              src={volumeButton}
              alt="volume button"
              className="video__volume-img"
            />
          </button>
        </div>
      </div>
    </div>
  );
}
